import { useRouter } from 'next/router';
import axiosInstance from '../../config';

export default () => {
	const router = useRouter();

	const getPlan = () => {
		axiosInstance.get('');
	};

	return (
		<div>
			<h1 onClick={getPlan}>{router.query.id}</h1>
		</div>
	);
};
